History Documentary hosted by Max Beesley, published by BBC in 2012 - English narration


Information
------------------------------

Chatsworth
Three-part documentary series detailing life of the new aristocracy over Chatsworth's entire 2011 season. For the first time ever, the palace of the peaks, Chatsworth House in Derbyshire, has opened its doors to the cameras for a whole year. It is a unique opportunity to take an in-depth glimpse of life upstairs and downstairs in the 21st century.


3)  Part 3 
Summer arrives, bringing with it wedding season at Chatsworth, but there is a veil hanging over proceedings and it does not belong to the bride. For the entire 2011 season, the famous south and west wings have been covered in scaffolding as part of a massive renovation; but it could spell disaster for their burgeoning wedding business and the all-important wedding photographs. However, ever-resourceful events manager Kay Rotchford has some Photoshop magic up her sleeve. And after a year of being hidden behind scaffolding, Chatsworth's 14 million pound renovation is finally revealed, and the great old house is ready to face the future. A passionate patron of the arts, the duke's taste is brought into question when the visitors take exception to his latest exhibit - a Damien Hirst sculpture of the flailed St Bartholomew currently residing in the Chapel..

